import React from 'react';

const Login = (props) => {
    const {email, setEmail, password, setPassword, handleLogin, handleSignup, hasAcoount, setHasAccount, emailError, passwordError} = props;
    return(
        <section className="login">
            <div className="loginContainer">
                <label>Username</label>
                <input 
                type="text" 
                autoFocus
                requiredvalue={email}
                onChange={(e) => setEmail(e.target.value)}
                />
            </div>

        </section>
    )
};

export default Login;
